import React, {Component} from "react";
import './App.css';
import tasks from './sample/task.json';
import Tasks from './components/Tasks'


class App extends Component{

  state = {
    tasks: tasks
  }

  render(){
    return(
      <div>
        {this.state.tasks.map( e =>
        <div>
          <p key={e.id}>{e.id} - {e.titulo} - {String(e.estado)}</p>
          <Tasks/>
        </div> 
        )}
      </div>
    )
  }
}

export default App;
